import React from 'react';

export default function SectionComponent(props) {
    return (
        <div style={{ backgroundImage: `url(${props.image})`, backgroundRepeat: 'no-repeat', backgroundSize: 'cover', height: '400px' }}>
            <p>
                {props.text}
            </p>
        </div>
    )
}
